import React from 'react'
import { useState, useEffect } from 'react';
import { Navigate, useNavigate } from 'react-router-dom';
import Navbar from '../../components/Navbar';

function UserDashboard({user}) {

  let navigate = useNavigate()

  console.log(user)

  return (
    <div>
      <div div className='flex h-screen'>
        <div className="px-4 py-2 bg-gray-200 bg-indigo-600 lg:w-1/4">
        <svg xmlns="http://www.w3.org/2000/svg" class="inline w-8 h-8 text-white lg:hidden" fill="none"
                    viewBox="0 0 24 24" stroke="currentColor">
                    <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M4 6h16M4 12h16M4 18h16" />
                </svg>
                <div class="hidden lg:block">
                    <div class="my-2 mb-6">
                        <h1 class="text-2xl font-bold text-white">{user.first_name}</h1>
                        </div>
                    </div>

        </div>
      </div>  
    </div>
  )
}

export default UserDashboard
